import React from 'react'
import { Button, Menu } from 'semantic-ui-react'

export const Kategorite = () => {
    return (
      <Menu>
    <Button.Group>
    <Button>One</Button>
    <Button>Two</Button>
    <Button>Three</Button>
  </Button.Group>
      </Menu>
    )
}
